CREATE DATABASE library_data;
USE library_data;

CREATE TABLE mytable(
  user_id            VARCHAR(50) NOT NULL PRIMARY KEY,
  book_id            VARCHAR(50) NOT NULL,
  borrow_date        DATE  NOT NULL,
  return_date        DATE  NOT NULL,
  reservation_status VARCHAR(5) NOT NULL,
  overdue_status     BINARY  NOT NULL,
  user_role          VARCHAR(50) NOT NULL,
  book_category      VARCHAR(50) NOT NULL
);

SELECT * FROM mytable;

/* Who are the top 10 book borrowers in the library? which is 1 unique */
SELECT user_id, COUNT(*) AS borrow_count
FROM mytable
GROUP BY user_id
ORDER BY borrow_count DESC
LIMIT 10;

/* Shows who borrows morestudents or faculty? */
SELECT user_role, COUNT(*) AS borrow_count
FROM mytable
GROUP BY user_role
ORDER BY borrow_count DESC;

/* Which genres are most read?  ART*/
SELECT book_category, COUNT(*) AS borrow_count
FROM mytable
GROUP BY book_category
ORDER BY borrow_count DESC;

/*Shows whether borrowing increases during exam months or drops during holidays.*/
SELECT DATE_FORMAT(borrow_date, '%Y-%m') AS month, COUNT(*) AS borrow_count
FROM mytable
GROUP BY month
ORDER BY month;

/*Which book category takes the most time to read on average?.*/
SELECT 
  book_category,
  AVG(DATEDIFF(return_date, borrow_date)) AS avg_days_to_read
FROM mytable
GROUP BY book_category
ORDER BY avg_days_to_read DESC;

/* Average reading time by user_role*/
SELECT 
  user_role,
  AVG(DATEDIFF(return_date, borrow_date)) AS avg_days_to_read
FROM mytable
GROUP BY user_role;

/*Is borrowing increasing or decreasing over time?*/
SELECT YEAR(borrow_date) AS year, COUNT(*) AS borrow_count
FROM mytable
GROUP BY YEAR(borrow_date)
ORDER BY year;

/*What types of books do students vs faculty prefer?*/
SELECT user_role, book_category, COUNT(*) AS borrow_count
FROM mytable
GROUP BY user_role, book_category
ORDER BY user_role, borrow_count DESC;

/*When do most books get borrowed? (exam season, holidays?)*/
SELECT 
  MONTHNAME(borrow_date) AS month,
  COUNT(*) AS borrow_count
FROM mytable
GROUP BY MONTH(borrow_date), MONTHNAME(borrow_date)
ORDER BY MONTH(borrow_date);


